// main.jsx
import React, { useState } from "react";
import axios from "axios";
import "./main.css";

const Main = () => {
  const [formData, setFormData] = useState({
    name: "",
    area: "",
    landOptions: "",
    materials: [],
  });
  const [predictedPrice, setPredictedPrice] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleMaterialsChange = (e) => {
    const { value, checked } = e.target;
    setFormData((prevData) => {
      const materials = checked
        ? [...prevData.materials, value]
        : prevData.materials.filter((material) => material !== value);
      return { ...prevData, materials };
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("/api/predict-price", formData);
      setPredictedPrice(response.data.price);
    } catch (error) {
      console.error("Error predicting price:", error);
    }
  };

  return (
    <div className="main-container container col-sm-12 col-md-12 col-lg-12 col-xl-12 p-5">
      <header className="text-center mb-5">
        <h1 className="display-4">Welcome to Opex Home Solutions</h1>
        <p className="lead">
          A complete solution for planning and designing your dream home
        </p>
      </header>

      <section className="price-prediction bg-white p-4 rounded shadow-sm">
        <h2 className="text-center mb-4">Get a Price Estimate</h2>
        <form onSubmit={handleSubmit} className="row g-3">
          <div className="col-sm-12 col-md-12 col-lg-12 col-xl-12">
            <label className="form-label">House Design Name:</label>
            <select
              name="name"
              className="form-select"
              value={formData.name}
              onChange={handleChange}
              required
            >
              <option value="">Select</option>
              <option value="Bungalow">Bungalow</option>
              <option value="Villa">Villa</option>
              <option value="Appartment">Appartment</option>
            </select>
          </div>

          <div className="col-sm-12 col-md-12 col-lg-6 col-xl-6">
            <label className="form-label">Area (in sqft):</label>
            <select
              name="area"
              className="form-select"
              value={formData.area}
              onChange={handleChange}
              required
            >
              <option value="">Select</option>
              <option value="500-1000">500-1000</option>
              <option value="1000-1500">1000-1500</option>
              <option value="1500-2000">1500-2000</option>
              <option value="2000-2500">2000-2500</option>
              <option value="2500-3000">2500-3000</option>
              <option value="3000-3500">3000-3500</option>
              <option value="3500-4000">3500-4000</option>
              <option value="4000-6000">4000-6000</option>
              <option value="6000-10000">6000-10000</option>
            </select>
          </div>

          <div className="col-md-6">
            <label className="form-label">Land Options:</label>
            <select
              name="landOptions"
              className="form-select"
              value={formData.landOptions}
              onChange={handleChange}
              required
            >
              <option value="">Select</option>
              <option value="Urban">Urban</option>
              <option value="Suburban">Suburban</option>
              <option value="Rural">Rural</option>
            </select>
          </div>

          <div className="col-12">
            <label className="form-label">Materials Required:</label>
            <div className="d-flex flex-wrap gap-3">
              {["Cement", "Concrete", "Wood", "Glass", "Marble Tiles"].map(
                (material) => (
                  <div key={material} className="form-check form-check-inline">
                    <input
                      type="checkbox"
                      className="form-check-input"
                      value={material}
                      onChange={handleMaterialsChange}
                      id={material}
                    />
                    <label className="form-check-label" htmlFor={material}>
                      {material}
                    </label>
                  </div>
                )
              )}
            </div>
          </div>

          <div className="col-12 d-flex justify-content-center">
            <button type="submit" className="btn btn-outline-dark btn-lg">
              Get Price Prediction
            </button>
          </div>
        </form>
        {predictedPrice && (
          <div className="result mt-4 text-center">
            <h3 className="text-success">Predicted Price: â‚¹{predictedPrice}</h3>
          </div>
        )}
      </section>
    </div>
  );
};

export default Main;
